Release Date  Feb 24, 2010 
Category  Feature, HD - Shot In High Def 
Director  Robby D 
Starring  Alexis Texas, Tori Black, Lexi Belle, Monique Alexander, Faye Reagan, Charles Dera, Aletta Ocean, Janie Summers, Kerry-Louise, James Deen, Mick Blue, Manuel Ferrara, Scott Nails 

A quick peek over the fence will reveal a world beyond your wildest fantasies. It's a world of teddy bears, night gowns and pillow fights, as well as handcuffs, dildos and paddles. Join Janie and friends as they give new meaning to &quot;friendly neighbor&quot;. Welcome to the world of the Girl Next Door!
